import React from 'react';
import Header from './Findztask/Header';
import { BrowserRouter as Router , Routes , Route } from 'react-router-dom'

function App() {
  return (
  <>
  <div className="container">
 <Header/>
 <Router>
      <Switch>
        <Route exact path="/">
          <Main />
        </Route>
       <Route path="/moviedetails/:id">
          <Moviedetails />
        </Route>
      </Switch>
    </Router>




 </div>

  </>
  );
}

export default App;
